const localStorage = require('localStorage');
const fromBase64 = require('fromBase64');
const getTime = require('getTimestampMillis');
const toNumber = require('makeNumber');
const JSON = require('JSON');

const dataKey = 'd708c13c9401028fb68c97967ec676a14e1e30290c436cf5524fd63d'; // La clave bajo la cual se almacenar√°n los datos del usuario en localStorage
const encryptedData= localStorage.getItem(dataKey);
const timeKey = 'ygcWK7sehIY3VbAIh8OdAA';
let userData = {};

// Verifica si el dato con TTL ha expirado
function hasExpired(expiryTime) {return getTime() > expiryTime;}

// Elimina datos expirados de localStorage
function clearExpiredData() {
    localStorage.removeItem(dataKey);
    localStorage.removeItem(timeKey);
}

// Obtiene un elemento de localStorage y verifica si ha expirado
function getItemWithTTL(data, time, expiry) {
  const expiryTime = toNumber(localStorage.getItem(time)) + expiry;
  const now = getTime();
  if (hasExpired(expiryTime)) {
    clearExpiredData();
    return true;
  }
}

if (!encryptedData) {
  if(!data.values_attributes_datalayer) return undefined; // Si no hay datos encriptados ni dataLayer termina
  // Si no hay datos encriptados pero s√≠ datalayer ve al c√≥digo principal
} else {
  // Si hay datos encriptado pero no hay dataLayer
  if(!data.values_attributes_datalayer) {
    // Vemos a ver si hay que borrarlos
    if(getItemWithTTL(dataKey, timeKey, 3600000)) return undefined;
    // Si no devolvemos los datos del usuario
    userData = JSON.parse(fromBase64(encryptedData));
    return userData;
  }
  // Si hay datos encriptados y DataLayer recogemos los datos encriptados para usarlos en el c√≥digo principal
  userData = JSON.parse(fromBase64(encryptedData));
}


// ====================================== Ejecuci√≥n Principal ======================================

// ---------------------------------Asignaci√≥n de m√≥dulos necesarios--------------------------------

const toBase64 = require('toBase64');

// ------------------------------------- Asignaci√≥n de variables ----------------------------------

const mainTypeData = ['email', 'phone_number'];
let feedbackNoDataAttributes; // En caso de no encontrar atributos
let dataModified = false; // Bandera para saber si se modific√≥ userData
// ------------------------------------- Funciones  auxiliares ------------------------------------

// Funci√≥n para verificar si todos los atributos relevantes est√°n vac√≠os
function allAttributesEmpty(attribute) {
  return !(attribute.id || attribute.class || attribute.name || attribute.type);
}

// Funci√≥n para comprobar si un atributo coincide con el dato correspondiente
function matchesAttribute(attribute, dataAttribute) { return !attribute || attribute === dataAttribute; }

// Funci√≥n para si alguno de los atributos asignados por el usuario coinciden con los del datalayer
function matchesDataLayer(attribute, values) {
  return matchesAttribute(attribute.id, values.id) && contains(attribute.class, values.class) &&
    matchesAttribute(attribute.name, values.name) && matchesAttribute(attribute.type, values.type);
}

// Funci√≥n para determinar si una cadena contiene una subcadena
function contains(subcadena, cadena) { return cadena.indexOf(subcadena) !== -1; }

function encryptData(data) { return toBase64(JSON.stringify(data)); }

function assignUserData(userData, attribute, value) {
  // Decide si asignar el valor directamente en userData o dentro de userData.address
  if (mainTypeData.indexOf(attribute.type_user_data) !== -1) {
    // Comprueba si el tipo de dato es "telefono" para a√±adir el prefijo "+34"
    if (attribute.type_user_data === 'phone_number' && value.substring(0, 3) !== '+34') {
      value = data.prefix_phone + value; // A√±ade el prefijo al valor
    }
    userData[attribute.type_user_data] = value;
  } else {
    // Asegura que userData.address exista antes de asignar el valor
    userData.address = userData.address || {};
    userData.address[attribute.type_user_data] = value;
  }
}

// ------------------------------------ Eventos Principales ------------------------------------

// Intenta recuperar y desencriptar los datos del usuario una sola vez, al inicio


// Itera a trav√©s de los atributos para encontrar coincidencias y asignar valores
for (const attribute of data.attributes) {
  // Comprueba si las cuatro columnas del atributo est√°n vac√≠as
  if (allAttributesEmpty(attribute)) {
    feedbackNoDataAttributes = 'No hay ning√∫n identificador seleccionado en los atributos del tipo dato ' + attribute.type_user_data;
    break; // Sale del bucle si no hay identificadores seleccionados
  }

  // Verifica coincidencias entre los atributos dados y los atributos en el dataLayer
  if (matchesDataLayer(attribute, data.values_attributes_datalayer)) {
    assignUserData(userData, attribute, data.values_attributes_datalayer.value);
    dataModified = true; // Marca que se han realizado cambios en userData
    break; // Sale del bucle despu√©s de asignar los datos
  }
}

// Si userData fue modificado, encriptar y guardar una sola vez al final
if (dataModified) { 
  localStorage.setItem(dataKey, encryptData(userData)); 
  localStorage.setItem(timeKey, getTime());
}

// Devuelve el feedback o los datos finales del usuario
return feedbackNoDataAttributes || userData;


